import "./header.css";


function Header(){
    return (
        <div className = "Header">
            <div className = "HeaderContainer">
                <div className = "HeaderContainerInside1">

                </div>
                <div className = "headerMenu">Menu</div>
                <div className = "headerTitle">Title</div>
                <div className = "headerAccount">Account</div>
                <div className = "headerSignUp">SignUp</div>
            </div>
        </div>
    )
}

export default Header;
